package com.weihong;

public class TestData {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		/*
		 * a. -5 + 8 * 6 b. (55+9) % 9 c. 20 + -3*5 / 8 d. 5 + 15 / 3 * 2 - 8 % 3
		 */
		int a = -5 + 8 * 6;
		int b = (55+9) % 9;
		int c = 20 + -3*5 / 8;
		int d = 5 + 15 / 3 * 2 - 8 % 3;
		System.out.println("a: " + a + " b: " + b + " c: " + c + " d: " + d);
		
		int input1 = 20;
		int input2 = 4;
		int sum = input1+input2;
		int multiply = input1*input2;
		int subtract = input1-input2;
		int divide = input1/input2;
		int remainder = input1%input2;
		
		System.out.println("Sum: " + sum + " multiply: " + multiply + " Subtract: " + subtract + " divide: " + divide + " remainder: " + remainder);
		
		
	}

}
